  false,\n\t\"url\": null,\n\t\"notes\": \"The Upper Yukon River, Alaska, possesses
  values which qualify it for inclusion in the National Wild and Scenic Rivers System.
  The Upper Yukon River and its immediate environment fulfills the requirements of
  the Wild and Scenic Rivers Act, and meets the supplemental criteria established
  jointly by the Secretary of the Interior and the Secretary of Agriculture, as published
  in Guidelines for Evaluating Wild, Scenic, and Recreational River Areas Proposed
  for Inclusion in the National Wild and Scenic Rivers System Under Section 2, Public
  Law 90-542, February 1970.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
